span\u003eDe statistiske \u003cb\u003edata\u003c/b\u003e som er n\u00f8dvendige for anvendelsen av\u003cbr\u003edenne artikkel, skal fastsettes av Kommisjonen i samsvar med regler\u003cbr\u003evedtatt av R\u00e5det etter fremgangsm\u00e5ten i artikkel 42. 29.3.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_data_1865\u003cbr\u003etype: usage\u003c/p\u003e", "x": 383.98504704731243, "y": 656.2384729079519}, {"color": "#377eb8", "id": "1929-1965_data_144", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\"111 617; Statsarkivet i Trondheim eier kj\u00f8bmann og r\u00e5dmann\u003cbr\u003eHenrik Hornemans optegnelser (hefte i 4to), hvorfra flere\u003cb\u003e dat\u003c/b\u003ea\u003cbr\u003etil ovenst\u00e5ende er hentet] Horneman, Jacob Hersleb, 1819\u201486, genealog,\u003cbr\u003eforstander, s\u00f8nn av ovennevnte assessor Christian Hersleb H., f. i\u003cbr\u003eTrondheim Ve 1819, eier av Sk\u00e5nes gard ved Levanger 1841\u201454, senere av\u003cbr\u003eVoldsminde gard i Strinda (nu innlemmet i Trondheims byomr\u00e5de),\u003cbr\u003eforstander for de offentlige stiftelser i Trondheim fra mars 1870 til\u003cbr\u003esin d\u00f8d, som inntraff i Trondheim 23 / 3 1886. Gift der Vo 1841 med\u003cbr\u003eAnette Blom, f. der 12 / 5 1820, d. p\u00e5 Sk\u00e5nes ved Levanger 8 /9 1854,\u003cbr\u003edatter av magistratspresident Jan B. og 2. hustru Anna Brun Kaasb\u00f8ll\u003cbr\u003eSommer. H. vokste op i et tradisjonsfylt milj\u00f8, hvor boklige\u003cbr\u003einteresser gjennem generasjoner hadde vaert tilstede. I familiens\u003cbr\u003ebyg\u00e5rd, \u00abHornemansg\u00e5rden\"\" ved torvet, et av Trondheims bekjente\u003cbr\u003e\u00abtrepalatser\"\", fantes et rikholdig familiebibliotek med mange\u003cbr\u003ebibliofilskatter og litteraere speci\u003cspan style=\"color:#808080;\"\u003emina.\"\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_data_144\u003cbr\u003etype: usage\u003c/p\u003e", "x": -372.26857470122945, "y": -281.7273759948437}, {"color": "#377eb8", "id": "1929-1965_data_235", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDataene for nyinvestering (rubrikk 3) framkommer som\u003cbr\u003erestst\u00f8rrelser, dvs. differanser mellom \u003cb\u003edata\u003c/b\u003e for samlet\u003cbr\u003einvestering og data for reinvestering. Se ogs\u00e5 punkt 2.6. 3.2\u003cbr\u003eModellene 5 og 6 Under forutsetning av at det bare er to alternativ,\u003cbr\u003eforutsetter modellene beregning av marginal intern rentefot ved\u003cbr\u003eovergang fra det alternativ som medf\u00f8rer det minste investeringsbel\u00f8p\u003cbr\u003e(alternativ 2) til det som medf\u00f8rer det st\u00f8rste investeringsbel\u00f8p\u003cbr\u003e(alternativ 1).\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_data_235\u003cbr\u003etype: usage\u003c/p\u003e", "x": 544.5420585186214, "y": 81.15084100866473}, {"color": "#377eb8", "id": "1970-2015_data_1253", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDet finnes med andre ord ikke entydige \u003cb\u003edata\u003c/b\u003e som viser at\u003cbr\u003esykefravaeret blant kvinner er h\u00f8yere enn blant menn. Til dette er\u003cbr\u003estatistikken for d\u00e5rlig. For fravaer p\u00e5 15 dager eller mer st\u00e5r\u003cbr\u003eimidlertid fravaer blant kvinner for mesteparten av \u00f8kningen i\u003cbr\u003esykepengeutbetalingene de senere \u00e5rene. \u00d8kningen den siste tida har\u003cbr\u003ebrakt sykefravaeret blant kvinner opp p\u00e5 samme niv\u00e5 som for menn. Det\u003cbr\u003efinnes heller ingen entydig forklaring p\u00e5 hvorfor sykefravaeret blant\u003cbr\u003ekvinner har \u00f8kt. I f\u00f8lge Kolberg er h\u00f8yt midlertidig fravaer fra ar-\u003cbr\u003eSykel\u00f8nnsordningen beidsmarkedet prisen vi m\u00e5 betale for h\u00f8y kvinnelig\u003cbr\u003esysselsetting. H\u00f8yt sykefravaer blant kvinner m\u00e5 sees p\u00e5 som en\u003cbr\u003en\u00f8dvendig tilp\u003cspan style=\"color:#808080;\"\u003easning.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_data_1253\u003cbr\u003etype: usage\u003c/p\u003e", "x": -75.08999982793812, "y": 20.31662682203253}, {"color": "#377eb8", "id": "1929-1965_data_88", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDe hittil foreliggende \u003cb\u003edata\u003c/b\u003e omfatter bare enkelte\u003cbr\u003eborhull, herunder beliggenhet, dybde, vannf\u00f8ring if\u00f8lge pr\u00f8vepumping\u003cbr\u003e(undertiden flere m\u00e5linger fra forskjellige dybder av samme\u003cbr\u003eborhull).\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_data_88\u003cbr\u003etype: usage\u003c/p\u003e", "x": -576.296129214854, "y": -120.27860115934325}, {"color": "#377eb8", "id": "1929-1965_data_227", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDerimot kan en ved hullkortmetoden f\u00e5 framstilt kopier av\u003cbr\u003emindre format enn originaiskjemaene, og en kan ogs\u00e5 f\u00e5 overf\u00f8rt\u003cbr\u003edataene i disse til lister som omfatter en rekke driftsenheter , De\u003cbr\u003euttalelser en har f\u00e5tt om skjema-kontra lister g\u00e5r ut p\u00e5 at \u003cb\u003edet\u003c/b\u003e\u003cbr\u003eer mere praktisk \u00e5 ha _ett skjema for hver driftsenhet enn \u00e5 ha lister\u003cbr\u003efor en rekke driftsenheter.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_data_227\u003cbr\u003etype: usage\u003c/p\u003e", "x": -134.20635775055612, "y": -463.31775276206764}, {"color": "#377eb8", "id": "1929-1965_data_256", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eLykkes det \u00e5 \u00f8ke denne vesentlig, vil konsekvensene vaere meget\u003cbr\u003estore, - men l\u00f8sningen ligger sannsynligvis langt frem i tiden. P\u00e5 det\u003cbr\u003ekommunikasjonsmessige omr\u00e5de er for tiden den paradoksale situasjon\u003cbr\u003eoppst\u00e5tt at man stadig \u00f8nsker \u00e5 f\u00e5 overbragt flere\u003cb\u003e dat\u003c/b\u003ea og mer\u003cbr\u003einformasjon, i form av ord, tall eller m\u00e5linger, og samtidig er man i\u003cbr\u003eferd med \u00e5 drukne i alle de opplysninger man innhenter og mottar.\u003cbr\u003eL\u00f8sninger p\u00e5 dette kan neppe finnes gjennom noe annet middel enn den\u003cbr\u003eelektroniske databehandling, og dette er nettopp et fagomr\u00e5de som\u003cbr\u003elangt fra er avklaret\u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_data_256\u003cbr\u003etype: usage\u003c/p\u003e", "x": -639.326799120813, "y": 170.7273944657147}, {"color": "#377eb8", "id": "1929-1965_data_96", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDe meteorologiske \u003cb\u003edata\u003c/b\u003e nedb\u00f8r og temperatur, hvorav\u003cbr\u003etemperaturen er inntegnet p\u00e5 plansjen, viser for Dalens vedkommende at\u003cbr\u003eden h\u00f8ye vannstand skyldes sterk kulde. Fra 7. til 14. febr. var\u003cbr\u003etemperaturen i Dalen (p\u00e5 plansjen er fremstillet kurven for\u003cbr\u003eminimumstemperaturen kl. 19 vedkommende dag) nede i 16 til 20\u003cbr\u003ekuldegrader, og dette faller sammen med br\u00f8nnenes og limnigrafenes\u003cbr\u003eh\u00f8ye vannstand som derfor antas \u00e5 skyldes isoppstuvning i elven.\u003cbr\u003eLimnigrafen Moen I har dessverre et avbrudd i registreringskurven for\u003cbr\u003edette tidsrum, mens limnigrafen Moen II viser en vannstand bare 5 cm\u003cbr\u003elavere enn den maksimale for 21/12.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_data_96\u003cbr\u003etype: usage\u003c/p\u003e", "x": -340.9279341572758, "y": 161.61532023848173}, {"color": "#377eb8", "id": "1970-2015_data_25972", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eAltinn er f\u00f8rst og fremst bygget for \u00e5 sende inn \u003cb\u003edata\u003c/b\u003e\u003cbr\u003eelektronisk.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_data_25972\u003cbr\u003etype: usage\u003c/p\u003e", "x": 291.1304398154154, "y": 289.0641261510208}, {"color": "#377eb8", "id": "1970-2015_data_876", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eFor \u00e5 f\u00e5 tilstrekkelig materialst\u00f8rrelser er man derfor\u003cbr\u003eavhengig av \u00e5 kombinere \u003cb\u003edata\u003c/b\u003e fra flere \u00e5r.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_data_876\u003cbr\u003etype: usage\u003c/p\u003e", "x": 608.9462579318039, "y": -321.46243552761626}, {"color": "#377eb8", "id": "1970-2015_data_16627", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eIngen restriksjoner p\u00e5 bearbeidede \u003cb\u003edata\u003c/b\u003e. ANDRE\u003cbr\u003eOPPLYSNINGER:\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_data_16627\u003cbr\u003etype: usage\u003c/p\u003e", "x": -138.00380860113887, "y": 355.0942778877902}, {"color": "#377eb8", "id": "1970-2015_data_4853", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eVi avslutter oversikten over sentrale kjennetegn ved klientene\u003cbr\u003emed en presentasjon av hva som i hovedsak var deres viktigste gj\u00f8rem\u00e5l\u003cbr\u003egjennom hele \u00e5ret 1990. Siden deltakelsen i l\u00f8nnsarbeid er generelt\u003cbr\u003elav, vil det vaere interessant \u00e5 vite hva de ellers bedrev tida med.\u003cbr\u003eDen type\u003cb\u003e dat\u003c/b\u003ea foreligger ikke i andre norske\u003cbr\u003eklientunders\u00f8kelser\u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_data_4853\u003cbr\u003etype: usage\u003c/p\u003e", "x": -42.75023337681778, "y": -220.6629555494622}, {"color": "#377eb8", "id": "1929-1965_data_236", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e3/ - \u25a0\u0027ing Bilag 4.3 KALKYLEMODELL 3 A. Forutsetninger for bruk\u003cbr\u003eav mo\u003cb\u003ed\u003c/b\u003eellen: 1. Investeringen er b\u00e5de reinvestering og\u003cbr\u003enyinvestering. 2. Kalkylens form\u00e5l er \u00e5 unders\u00f8ke l\u00f8nnsomheten av\u003cbr\u003enyinvesteringen. 3a Inntekter lar seg beregne, eller: b Hvis inntekter\u003cbr\u003eikke lar seg beregne, m\u00e5 nyinvesteringen ikke medf\u00f8re endring i\u003cbr\u003eproduksjonsmengden, men bare i kostnadene. 4. \u00d8konomisk levetid lik\u003cbr\u003eeller mindre enn 15 \u00e5r. B. Kalkyle: Nummereringen ved foten av\u003cbr\u003ebokstavene refererer seg til datarubrikkene 1, 2 og 3 Data for Data\u003cbr\u003efor Data for samlet in- reinve- nyinvevestering storing stering\u003cbr\u003eKalkylekomponenter a. Investeringsbel\u00f8p for produksjonsmiddel av\u003cbr\u003ebegrenset varighet, kr. d. Utrangeringsverdi for forannevnte, kr. n.\u003cbr\u003e\u00d8konomisk levetid for forarme vnte, \u00e5r. b.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_data_236\u003cbr\u003etype: usage\u003c/p\u003e", "x": 174.42501918849985, "y": 30.41227151158492}, {"color": "#377eb8", "id": "1970-2015_data_15113", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eEtter dette gjenst\u00e5r det \u00e5 gi en fremstilling av de\u003cbr\u003eopplysninger som skal vaere spesifikke for registreringen i\u003cbr\u003efrivillighetsregisteret, og som alts\u00e5 vil komme i tillegg til de\u003cb\u003e\u003cbr\u003edat\u003c/b\u003ea som registreres i Enhetsregisteret\u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_data_15113\u003cbr\u003etype: usage\u003c/p\u003e", "x": -416.340946417617, "y": 464.52609544199214}, {"color": "#377eb8", "id": "1929-1965_data_255", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eHer inng\u00e5r elektronisk utstyr i vesentlig grad for linje- og\u003cbr\u003ekabelforbindelser og for radiolinjer ved overf\u00f8ring av telefoni,\u003cbr\u003etelegrafi, m\u00e5letekniske \u003cb\u003edata\u003c/b\u003e osv.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_data_255\u003cbr\u003etype: usage\u003c/p\u003e", "x": 130.1669759952493, "y": 525.9342690905365}, {"color": "#377eb8", "id": "1929-1965_data_153", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eIte henvisninger til nyere litteratur er tatt med. I \u00abSummary\u00bb\u003cbr\u003eer disse \u003cb\u003edata\u003c/b\u003e brukt som innledning til \u00abPetrology of the\u003cbr\u003erocks\u00bb, som p\u00e5 grunn a\\ Foslies fyldige og omhyggelige unders\u00f8kelser\u003cbr\u003em\u00e5tte refereres utf\u00f8rlig. De to eldre driftsperiodei som Foslie har\u003cbr\u003ebeskrevet ovenfor \u2022ra Christiansgaves (Lilledales) kobberverks\u003cbr\u003ehistorie, angar utelukkende \u00d8lvehalv\u00f8ya.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_data_153\u003cbr\u003etype: usage\u003c/p\u003e", "x": 456.8727833023714, "y": -147.6002154400453}, {"color": "#377eb8", "id": "1929-1965_data_81", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDet betegner sig som nr. 15 av 4. \u00e5rgang, og disse \u003cb\u003edata\u003c/b\u003e\u003cbr\u003egir oss da tydelig til kjenne at bladet kom ut en gang om uken, da jo\u003cbr\u003e13. april falt i 15. uke av \u00e5ret 1772. P\u00e5 det tittelhode som avisen er\u003cbr\u003eutstyrt med uttales det for \u00f8vrig at den kom ut \u00abUgentlig i\u003cbr\u003eArendahl\u00bb.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_data_81\u003cbr\u003etype: usage\u003c/p\u003e", "x": -179.49431972368083, "y": -750.0}]);

        network = new vis.Network(container, data, options);
	 
        


        

        return network;

    }

    drawGraph();
